           form to submit <button type='submit'>Submit</button>
       </form>
   }

    return (
        <>
            <div className="container-fluid bg-secondary text-center p-5">
                <h1>Register</h1>
            </div>
            <div className="container">
                <div className="row">
                    <div className="col-md-6 offset-md-3">
                        {registerForm()}
                    </div>
                </div>
            </div>
        </>
    )
}

